import React from 'react';

function Mirage() {

    const [data, setData] = React.useState(null);
    React.useEffect(() => {
        fetch('/api/movies')
            .then((res) => res.json())
            .then((json) => {
                setData(json.movies)
            })
    }, [])

    return (
        <ul>
            {data.map((datas) => (
                <li key={data.id}>{data.name}</li>
            ))}
        </ul>
    );
}

export default Mirage;
